import React from 'react'
import "../pages/Signup.css";

export default function Signup() {
    return (
        <div className="bg">
            <div className="form">
                <form>
                    <label>Email</label>
                    <input type="email" />
                    <label>Password</label>
                    <input type="password" />
                </form>
            </div>
        </div>
    )
}
